export const dialogs = [
    {
        content: '嗨！付祖贤，看到头像应该很熟悉吧。是的呢，我们以前可是拿这个作情侣头像的呢',
        who: 0,
        delay: 0
    },
    {
        content: '哦，你干嘛',
        who: 1,
        delay: 0
    },
    {
        content: '今天是你生日！ 2018 年 12月 6日，也是农历 10月 29。我记得，以后会记一辈子',
        who: 0,
        delay: 0
    },
    {
        content: '你最好给我记着(＠￣ー￣＠)',
        who: 1,
        delay: 0
    },
    {
        content: '我们花两年的时间认识彼此。这是我最不能忘记的两年，大三一年，毕业后一年',
        who: 0,
        delay: 0
    },
    {
        content: '嗯哼？',
        who: 1,
        delay: 0
    },
    {
        content: '两年的时间我觉得我们经历了许多',
        who: 0,
        delay: 0
    },
    {
        content: '我们一起复习期末考试、一起逛街、一起吃饭、一起看电影、一起淋雨、一起逛校园、一起看尽杭州的景色...',
        who: 0,
        delay: 0
    },
    {
        content: '行了行了，我不要听这些，你就说你能不能改了你的臭毛病？哼',
        who: 1,
        delay: 0
    },
    {
        content: '哈? 我有啥臭毛病',
        who: 0,
        delay: 0
    },
    {
        content: '天天只知道睡觉，懒得跟树懒一样，一点都不上进，养老吧，哼。',
        who: 1,
        delay: 0
    },
    {
        content: '这...咳咳，我一定改正，为了我们的未来！',
        who: 0,
        delay: 0
    },
    {
        content: '我可没有开玩笑，说到一定做到，这是一个摩羯座应该有的特质',
        who: 0,
        delay: 0
    },
    {
        content: '说到星座，我给你的那本书你看了没有？',
        who: 1,
        delay: 0
    },
    {
        content: '必须看了，那都得研读，我很珍惜...',
        who: 0,
        delay: 0
    },
    {
        content: '你',
        who: 0,
        delay: 0
    },
    {
        content: '这还差不多。',
        who: 1,
        delay: 0
    },
    {
        content: '那我今天过生日你送我什么礼物呀？',
        who: 1,
        delay: 0
    },
    {
        content: '我还真想现在就出现在你面前送给生日蛋糕、鲜花。',
        who: 0,
        delay: 0
    },
    {
        content: '不过虽然我现在不能出现在你面前，我相信此时时刻我们的心是相通的',
        who: 0,
        delay: 0
    },
    {
        content: '我才不信，我们有13个小时的时差，你现在一定在睡大觉，哼',
        who: 1,
        delay: 0
    },
    {
        content: '不要生气嘛，惊喜在后面。',
        who: 0,
        delay: 0
    },
    {
        content: '你有什么话想对我说的？',
        who: 0,
        delay: 0
    }
]

